function ViewCandidate() {
    const location = useLocation();
    const { candidateIdd } = location.state || {}; // Get the passed data safely

    return (
        <div>
            <h1>Candidate ID: {candidateIdd}</h1>
        </div>
    );
}

export default ViewCandidate;
